INSERT INTO `message` (`id`, `message`, `email`, `seen`, `send_date`, `seen_date`) VALUES
(1, 'In phylogenetics, maximum parsimony is an optimality criterion under which the phylogenetic tree that minimizes the total number of character-state changes is to be preferred. Under the maximum-parsimony criterion, the optimal tree will minimize the amount of homoplasy (i.e., convergent evolution, parallel evolution, and evolutionary reversals). In other words, under this criterion, the shortest possible tree that explains the data is considered best. The principle is akin to Occam\'s razor, which states that—all else being equal—the simplest hypothesis that explains the data should be selected. Some of the basic ideas behind maximum parsimony were presented by James S. Farris [1] in 1970 and Walter M. Fitch in 1971', 'elfaqir963@gmail.com', 1, '2016-11-04 14:57:24', '2016-11-04 17:07:41'),
(3, 'ok', 'kkkkkkk@kk.com', 1, '2016-11-04 16:34:04', '2016-11-04 16:34:31');

